import request from '@/utils/request';
export function login(data) {
  return request({
    url: '/user/login',
    method: 'post',
    data: data
  });
}
export function logout() {
  return request({
    url: '/user/login_out',
    method: 'get'
  });
}
export function getInviteUrl() {
  return request({
    url: '/user/invite/code',
    method: 'get'
  });
}
export function getInviteTotal() {
  return request({
    url: '/user/invite/total',
    method: 'get'
  });
}
export function getCoin() {
  return request({
    url: '/user/money',
    method: 'get'
  });
}
export function getOrder() {
  return request({
    url: '/user/order',
    method: 'get'
  });
}
